import React from "react";
import { BiListUl, BiEditAlt, BiSearchAlt } from "react-icons/bi";
import { Link } from "react-router-dom";

function MemoList(props) {
  const memoList = props.memoData.map((memo) => (
    <div className="todoList" key={memo.idx}>
      <div className="todoListTitle">TITLE : {memo.title}</div>
      <div className="todoListTxt">{memo.content}</div>
    </div>
  ));

  return (
    <div className="todo-list-template">
      <div className="list-area">{memoList}</div>
    </div>
  );
}

export default MemoList;
